Out of the 39 people who recalled 1 or more dream, 68-11=57 people from Group Y recalled 5 or more dreams. So, the probability that a person chosen at random from those who recalled at least 1 dream belonged to Group Y is:

\begin{align*}
\frac{57}{39+57} &= \frac{57}{96} \\
&= \frac{19}{32}
\end{align*}

Therefore, the answer is $\boxed{\textbf{(C)}\ \frac{79}{164}}$.

The probability that a person is chosen at random from those who recalled at least 1 dream is: $$P(\text{at least 1 dream}) = \frac{39+125}{200} = \frac{164}{200}$$
The probability that the person who recalled at least 1 dream belonged to Group Y is: $$P(\text{Group Y}|\text{at least 1 dream}) = \frac{P(\text{at least 1 dream}|\text{Group Y})\cdot P(\text{Group Y})}{P(\text{at least 1 dream})}$$
We can find the probabilities in the above expression from the table. We have:
\begin{align*}
P(\text{at least 1 dream}|\text{Group Y}) &= \frac{11+68}{100} = \frac{79}{100}\\
P(\text{Group Y}) &= \frac{100}{200} = \frac{1}{2}
\end{align*}
Plugging in these values, we get:
\begin{align*}
P(\text{Group Y}|\text{at least 1 dream}) &= \frac{\frac{79}{100}\cdot\frac{1}{2}}{\frac{164}{200}}\\
&= \frac{79}{164}
\end{align*}
Therefore, the answer is $\boxed{\textbf{(C)}\ \frac{79}{164}}$.

The probability that the person recalled at least 1 dream is $\frac{39+125}{200}=0.82$. Among those who recalled at least 1 dream, the probability that the person belonged to Group Y is $\frac{68}{39+68}=\frac{68}{107}$. Therefore, the probability that the person belonged to Group Y given that the person recalled at least 1 dream is \begin{align*}
\frac{\frac{68}{107}}{0.82} &= \frac{68}{107\cdot 0.82} \\ &= \frac{68}{87.74} \\ &\approx \boxed{\textbf{(C) } \frac{79}{164}}.
\end{align*}
